import Men from './Men.png'
import Women from './Women.png'
import Shoes from './Shoes.png'
import Watch from './Watch.png'

let category_product = [
  {
    id:1,
    name:"Men",
    image:Men,
  },
  {
    id:2,
    name:"Women",
    image:Women,
  },
  {
    id:3,
    name:"Shoes",
    image:Shoes,
  },
  {
    id:4,
    name:"Watch",
    image:Watch,
  },
];

export default category_product;
